import React from 'react';
import './Home.css';
import HeroSection from '../HeroSection';
import Navbar from '../../components/Navbar';


function Home() {
  return (
    <div className='home'>
      <Navbar/>
      <HeroSection/>
    </div>
  )
}

export default Home
